import React, { useState, useEffect } from 'react';
import axios from 'axios';

function HelloWorld() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    axios.get('http://localhost:8000/he/')
      .then(response => {
        setMessage(response.data.message);
      })
      .catch(error => {
        console.error(error);  // Changed to console.error for better visibility of errors
      });
  }, []);

  return (
    <div className="bg-white shadow-md rounded-lg p-8 max-w-md mx-auto">
      <h2 className="text-3xl font-semibold text-center mb-8">Facebook</h2>
      <form>
        <div className="mb-4">
          <label htmlFor="email" className="block text-gray-700 font-semibold mb-2">Email address or phone number</label>
          <input type="email" id="email" className="w-full border-gray-300 rounded-lg shadow-sm appearance-none leading-tight focus:outline-none focus:shadow-outline" placeholder="Enter your email or phone number" />
        </div>
        <div className="mb-6">
          <label htmlFor="password" className="block text-gray-700 font-semibold mb-2">Password</label>
          <input type="password" id="password" className="w-full border-gray-300 rounded-lg shadow-sm appearance-none leading-tight focus:outline-none focus:shadow-outline" placeholder="Enter your password" />
        </div>
        <div className="flex items-center justify-between">
          <button type="submit" className="bg-blue-500 hover:bg-blue-700 text-white font-semibold py-2 px-4 rounded-lg shadow-md focus:outline-none focus:shadow-outline">
            Log In
          </button>
          <a href="#" className="inline-block align-baseline font-semibold text-sm text-blue-500 hover:text-blue-800">
            Forgot Password?
          </a>
        </div>
      </form>
    </div>
  );
}

export default HelloWorld;
